import { Component, Input } from '@angular/core';

@Component({
  selector: 'app-edit',
  templateUrl: './edit.component.html',
  styleUrls: ['./edit.component.css']
})
export class EditComponent {
  @Input() selectedResult;

  test() {
    console.log(this.selectedResult)
  }
}
